import React, { useEffect } from "react";
import axios from "axios";

const GetPhotos = () => {
  return axios
    .get("// https://picsum.photos/v2/list")
    .then(function (response) {
      // handle success
      console.log(response);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
};
const Photos = () => {
  console.log("outside");
  useEffect(() => {
    console.log("inside");
  }, []);
  return <div>Photos</div>;
};

export default Photos;
